const parseSetlistLink = (url) => {
  let urlArray = url.split('-');
  let urlLast = urlArray.pop();
  let setlistID = urlLast.split('.')[0];
  return setlistID;
}

// Method to return the getTime of today at 00:00:00
const getNowZeroTime = () => {
  const now = new Date();
  now.setHours(0);
  now.setMinutes(0);
  now.setSeconds(0, 0);
  return now.getTime();
}



export { parseSetlistLink }
